import { navData } from "../lib/navData";
import "./Sidenav.css";

export default function Sidenav() {
    return (
        <div>
            {
                navData.map(item =>{
                    return <div key={item.id} className="sideitem">
                                {item.icon}
                                <span className="linkText">{item.text}</span>
                            </div>
                })
            }
        </div>
    )
}
